The Mike Rosen Radio Show JAN-10-2014 FRI..............PODCAST


Friday, January 10, 2014



Update On &quot;Bridgegate&quot;




 - 1PM Hour

1. Mike defends use of the term the &quot;knockout game.&quot; 
2. Mike answers the letter to the editor of the day concerning energy costs. 
3. Mike deconstructs Eugene Robinson column on &quot;Bridgegate.&quot; 
4. Guest: Yaron Brook,  
      Executive Director of the Ayn Rand Institute - A discussion of income inequality.

 - 2PM Hour

1. Guest: Dick Wadhams, Republican strategist 
     - Senator Udall and Obamacare. 
2. Movie Review: Mike reviews &quot;The Secret Life of Walter Mitty&quot;
